import React from 'react'

export default function Item(props) {
  return (
        <div className='item'>
            <img src={"./img/"+ props.item.img}/>
            <h2>{props.item.title}</h2>
            <p>{props.item.desc}</p>
            <b>{props.item.price}$</b>
            <div className='add-to-card'></div>

        </div>
  )
}
